css:
@-moz-document domain("wikipedia.org") {

body, .mw-page-container, .mw-page-container-inner, .mw-body
, .mw-table-of-contents-container, .vector-toc, .thumb, .thumbinner
, .infobox {
  background-color: #D9D7D3 !important;
}
.thumb, .thumbinner, .infobox {
  background-color: #ccc !important;
}
.infobox { border:none;}

.vector-toc:after {
  background: none !important;
}
.vector-feature-page-tools-disabled .mw-page-container-inner {
    column-gap: 10px;
}


}
